	"nome": "Sindrome do Impostor" ,
	"descricao": "A síndrome do impostor é um distúrbio psicológico que acomete pessoas nas mais diversas áreas de atuação. Desse modo, quem é acometido por esse problema tende a não reconhecer suas conquistas profissionais e pessoais como sendo fruto do seu esforço e capacidade."
}

{
