	"nome": "Sindrome do Impostor e Ansiedade",
	"descricao": "A síndrome do impostor é caracterizada por pessoas que têm tendência à autossabotagem. Então, o indivíduo constrói, dentro da cabeça dele, uma percepção de si mesmo de incompetência ou insuficiência. Naturalmente, todo o cérebro humano possui essa pré-disposição a colocar essa sensação de incapacidade e demérito."
}

